import { HashRouter, Switch,} from 'react-router-dom';
import React from 'react';
import Navbar from './components/Navbar';

export default function main() {
    
    return (
        <>
        <div>
            <HashRouter>
                <Navbar/>
                <div className='content'></div>

                <Switch>
                    <Route exact path="/" component={Home}/>
                    <Route exact path="/" />
                    <Route exact path="/" />
                </Switch>
            </HashRouter>
        </div>
        
        </>
    );
    
}
